import React from "react";
import Card from "react-bootstrap/Card";


class NewsCard extends React.Component {
  render() {
    return (
      <Card>
        <Card.Body>
          <Card.Title>Заголовок новости</Card.Title>
          <Card.Text>Текст новости</Card.Text>
        </Card.Body>
      </Card>
    );
  }
}

export default NewsCard;
